INSERT INTO `SERVMASK_PREFIX_posts` VALUES (10,1,'2020-11-04 19:31:56','2020-11-04 19:31:56','<h2><span id=\"Name\" class=\"mw-headline\">Name</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span>change<span class=\"mw-editsection-divider\">|</span>change sour</span>ce<span class=\"mw-editsection-bracket\" style=\"letter-spacing: -0.0415625em;\">]</span></h2>\r\nCars are also called<b>automobiles</b>, which comes from theGreekprefix\"\" (auto) and theFrenchword \"mobile\". This name means \"self-moving\", as cars run on their ownpowerand do not needhorsesor other power from outside to move.\r\n<h2><span id=\"Types_of_cars\" class=\"mw-headline\">Types of cars</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span>change<span class=\"mw-editsection-divider\">|</span>change source<span class=\"mw-editsection-bracket\">]</span></span></h2>\r\nLike other automobiles, cars are made in different shapes and sizes, for people with differentneeds. Here are some common types of cars.\r\n<ul>\r\n 	<li>A<b>convertible</b>is a car with a roof that can be opened or taken off for an open-air drive. Sportier convertibles are called<b>roadsters</b>.</li>\r\n 	<li>A<b>hatchback</b> is a smaller car with a cargo area that uses the same space as the cabin (instead of a separate trunk-like in a sedan or coup). They combine the sportiness of coups and sedans with the storage space ofSUVs.\r\n<ul>\r\n 	<li>A<b>station wagon</b>(<b>estate car</b>inBritish English) is a hatchback-like car that has a less sloped rear window and more space for passengers andluggage.</li>\r\n</ul>\r\n</li>\r\n 	<li>A<b>pickup truck</b>is a truck with a separate cabin and cargo area on aladder frame. The cargo area is called the \"<i>bed</i>\".</li>\r\n 	<li>A<b>sedan</b> is a car with a sloped rear window and a separate trunk that has four doors.\r\n<ul>\r\n 	<li>A<b>coup</b>(<b>coupe</b>inAmerican English) is like a sedan, but usually only has two doors and is seen as sportier than a sedan.</li>\r\n</ul>\r\n</li>\r\n 	<li>An<b>SUV</b>(sport utility vehicle) is a rugged automobile that has a combined passenger and cargo area (like in hatchbacks, station wagons, and vans). SUVs are very popular due to their usefulness.</li>\r\n 	<li>A<b>van</b>is a big box-shaped automobile meant for carrying plenty of passengers orcargo. There are many different sizes of vans, such asminivans, which are made forfamilies.</li>\r\n</ul>\r\n<h2><span id=\"Energy\" class=\"mw-headline\">Energy</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span>change<span class=\"mw-editsection-divider\">|</span>change source<span class=\"mw-editsection-bracket\">]</span></span></h2>\r\nTo make a car move, it must have the energyto turn the wheels. This energy might bechemical energyingasolineorelectrical energyin abattery. How quickly the engine or motor can send the energy to the wheels, and how much energy is sent, is called thepowerof the motor. The power of a car is usually measured inkilowattsorhorsepower.\r\n<h3><span id=\"Gasoline\" class=\"mw-headline\">Gasoline</span><span class=\"mw-editsection\"><span class=\"mw-editsection-bracket\">[</span>change<span class=\"mw-editsection-divider\">|</span>change source<span class=\"mw-editsection-bracket\">]</span></span></h3>\r\nAs of 2019, most cars burn fuelto make aninternal combustion engine(sometimes called a \"motor\") run. The power from the engine then goes to the wheels through atransmission, which has a set ofgearsthat can make the car go faster or slower. The most common fuel ispetrol, which is called \"<i>gasoline</i>\" or \"<i>gas</i>\" in American English.\r\n\r\nGasoline is called afossil fuelbecause it comes from tinyfossilsthat were made millions of years ago. Over millions of years, they turned intooil, which was thendrilled upfrom deep inside theEarth, and then turned into fuel bychemical changes. Old gasoline-powered cars are noisy and theirexhaust makes the cityair dirty, which can make people ill. But cars made after the mid-2010sare cleaner.<sup id=\"cite_ref-1\" class=\"reference\">[1]</sup>\r\n\r\nBurning gasoline, like any kind of fossil fuel, makescarbon dioxide, which makesglobal warming. Since 2017, less gasoline-powered cars are being made,<sup id=\"cite_ref-Cleantech2019_2-0\" class=\"reference\">[2]</sup><sup id=\"cite_ref-3\" class=\"reference\">[3],</sup> and some places will not allow gasoline-powered cars in the future, likeAmsterdamin 2030.<sup id=\"cite_ref-4\" class=\"reference\">[4]</sup>','','','publish','open','closed','','10','','','2020-11-04 19:33:39','2020-11-04 19:33:39','',0,'http://localhost/MyShop/?post_type=product&#038;p=10',0,'product','',0);
