INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (1,'wc-admin-wc-helper-connection','info','en_US','Connect to WooCommerce.com','Connect to get important product notifications and updates.','{}','unactioned','woocommerce-admin','2020-11-04 19:01:25',NULL,0,'plain','',0,'info');
INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (2,'wc-admin-onboarding-email-marketing','info','en_US','Tips, product updates, and inspiration','We\'re here for you - get tips, product updates and inspiration straight to your email box','{}','unactioned','woocommerce-admin','2020-11-04 19:01:26',NULL,0,'plain','',0,'info');
INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (3,'wc-admin-marketing-intro','info','en_US','Connect with your audience','Grow your customer base and increase your sales with marketing tools built for WooCommerce.','{}','unactioned','woocommerce-admin','2020-11-04 19:01:27',NULL,0,'plain','',0,'info');
INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (4,'ecomm-need-help-setting-up-your-store','info','en_US','Need help setting up your Store?','Schedule a free 30-min <a href=\"https://wordpress.com/support/concierge-support/\">quick start session</a> and get help from our specialists. Were happy to walk through setup steps, show you around the WordPress.com dashboard, troubleshoot any issues you may have, and help you the find the features you need to accomplish your goals for your site.','{}','pending','woocommerce.com','2020-11-04 19:01:28',NULL,0,'plain','',0,'info');
INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (5,'woocommerce-services','info','en_US','WooCommerce Shipping & Tax','WooCommerce Shipping &amp; Tax helps get your store ready to sell as quickly as possible. You create your products. We take care of tax calculation, payment processing, and shipping label printing! Learn more about the extension that you just installed.','{}','pending','woocommerce.com','2020-11-04 19:01:28',NULL,0,'plain','',0,'info');
INSERT INTO `SERVMASK_PREFIX_wc_admin_notes` VALUES (6,'ecomm-unique-shopping-experience','info','en_US','For a shopping experience as unique as your customers','Product Add-Ons allow your customers to personalize products while theyre shopping on your online store. No more follow-up email requestscustomers get what they want, before theyre done checking out. Learn more about this extension that comes included in your plan.','{}','pending','woocommerce.com','2020-11-04 19:01:29',NULL,0,'plain','',0,'info');
